        mw: '',
        stressDrop: '',
        kappa: '',
        kappaFlag: 1,
        faultEdge: '',
        angles: '',
        faultType: '',
        width: '',
        hypoAlongFault: '',
        hypoDownDip: '',
        vrupBeta: '',
        slipWeights: ''
    });

